import React from 'react';
import Lottie from 'lottie-react';
import successAnimation from '../'; // Download a free success Lottie animation

const SuccessPage = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gradient-to-br from-blue-500 to-green-500 text-white">
      {/* Lottie Animation */}
      <div className="w-72 h-72">
        <Lottie animationData={successAnimation} loop={true} />
      </div>

      {/* Text Content */}
      <h1 className="text-4xl md:text-6xl font-extrabold mb-4">Thank You!</h1>
      <p className="text-lg md:text-xl mb-6 text-center">
        Your order has been successfully placed.
      </p>
      <a
        href="/"
        className="px-6 py-3 bg-white text-blue-500 font-bold rounded-full shadow-lg hover:bg-blue-100 transition duration-300"
      >
        Back to Home
      </a>

      {/* SVG Pattern */}
      <svg
        className="absolute bottom-0 left-0 w-full"
        xmlns="http://www.w3.org/2000/svg"
        viewBox="0 0 1440 320"
      >
        <path
          fill="#ffffff"
          fillOpacity="0.1"
          d="M0,256L80,234.7C160,213,320,171,480,170.7C640,171,800,213,960,224C1120,235,1280,213,1360,202.7L1440,192L1440,320L1360,320C1280,320,1120,320,960,320C800,320,640,320,480,320C320,320,160,320,80,320L0,320Z"
        ></path>
      </svg>
    </div>
  );
};

export default SuccessPage;
